Description. Adult (
Figs 40, 41
). Wingspan 9.0−14.0 mm. Vertex yellowish white, frons pale yellowish brown. Antenna 0.9× length of forewing; scape yellowish white, tinged with yellowish brown, with a few black pecten bristles; flagellum variegated, yellowish white on ventral surface, dark purplish brown on dorsal surface except first few segments yellowish white. Labial palpus yellowish brown on inner surface, dark brown on outer surface. Thorax and tegula blackish brown. Forewing index 0.25−0.3, coppery brown, individual scales dark tipped, especially obvious in distal 1 / 5 ; retinaculum present; cilia coppery brown with darker tips, with three welldefined cilia lines. Hindwing grayish brown; male with a single short, slender, evenly curved frenular bristle, female with two slender bristles, shorter one 0.4× length of longer one; cilia grayish white. Fore and mid legs blackish brown; hind leg yellowish brown, tarsus dark brown above.

Male genitalia (
Fig. 71
). Vinculum straight on anterior margin, shallowly concave in broad V shape at middle on posterior margin; medial process on ventrocaudal margin short, Y-shaped, 0.4× length of depth of vinculum. Tegumen about 0.15× depth of vinculum, narrow band-like. Uncus with lobate base separated by membrane; uncus lobe small, short, 0.3× depth of vinculum, not twisted, basal half expanded, distal half digitate, melanized, strongly bent ventrad; sclerite present between uncus lobes, rhombic. Valva knife-like, basal half broad, sharply narrowed beyond middle, then gradually narrowed to rounded apex; costal margin straight, unmodified; basal flange large, basal 2 / 3 semicircular, outer margin smooth, concave inward medially, inner margin with basal 2 / 3 arched, bearing stout spines and setae, distal 1 / 3 rounded, with sparse setae, two horned, tip-melanized processes situated at about middle near inner margin; bridging lobe from basal 2 / 3 of basal flange to valva, very shallow; ventral margin convex, forming obvious ventral lobe in basal half, straight in distal half,; basal margin with large, triangular ‘secondary apodeme’ bearing stout setae, close to ventral margin; inner surface bearing peg-like sensillae apically. Juxta about 0.5× length of aedeagus, reflexed anteriorly along inner surface of vinculum, narrow, grooved in dorsal midline, usually folded laterally, Y-shaped when spreaded. Aedeagus short, 0.5× length of valva, slightly bent dorsad; double-walled: inner wall tubular, outer wall broad at base, narrowed to apex. Bulbus ejaculatorius 5.0× length of aedeagus, subdistal section slightly expanded and curved, distal section expanded, as broad as subdistal section.

Female genitalia (
Fig. 90
). Ovipositor length 2.8 mm. Eighth tergite convex anteromedially, slightly concave on posterior margin, microtrichiate on posterior 1 / 3 , with sparse setae in posterior 1 / 5 . Eighth sternite deeply convex at middle on anterior margin, with a pair of horned processes at middle on posterior margin. Ostium longitudinal, 0.5× length of eighth sternite. Antrum indistinct; ductus bursae very narrow, 1.5× length of corpus bursae. Colliculum comprising a pair of ivory-shaped, apically spinose processes extending from junction of ductus bursae and corpus bursae, invaginated into corpus bursae to level of second ring; second ring at posterior 1 / 5 of corpus bursae, with a tongue-shaped ventral extension; a separate bowl-shaped sclerite placed anterior to tongue-shaped ventral extension; inception of ductus seminalis opposite to tongue-shaped extension of second ring. Corpus bursae with posterior 1 / 3 narrow, anterior 2 / 3 broadened and ovate; signum absent.
